/* Micro reset */
*,
*:before,
*:after {
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}
body,
html {
  height: 100vh;
  font-family: Helvetica, Arial, sans-serif;
  color: #222;
  background-color: #14141e;
}
#nav {
  position: absolute;
  z-index: 1;
  left: 0px;
  top: 0px;
  bottom: 0px;
  width: 200px;
  line-height: 60px;
  color: #222;
  background: 0 0;
  border-right: 1px solid rgba(0, 0, 0, 0.1);
  text-transform: lowercase;
  font-size: 0.9em;
  letter-spacing: 1px;
  background-color: rgba(112, 112, 112, 0.2);
  flex-direction: row;
  flex-flow: wrap;
}
#nav a {
  padding: 0 2rem;
  text-decoration: none;
  color: #eee;
  font-size: 1.2em;
  line-height: 60px;
  display: inline-block;
  width: 100%;
  transition: background-color 0.3s;
}
#nav a:first-child {
  font-weight: bold;
}
#nav a:hover {
  background-color: rgba(112, 112, 112, 0.2);
  color: #fff;
}
.nav-trigger {
  position: absolute;
  clip: rect(0, 0, 0, 0);
}
label[for="nav-trigger"] {
  position: fixed;
  left: 15px;
  top: 15px;
  z-index: 200;
  height: 30px;
  width: 30px;
  cursor: pointer;
  filter: drop-shadow(0px 0px 1px #000000);
}
label[for="nav-trigger"] * {
  -webkit-transition: all 0.3s;
  transition: all 0.3s;
  box-sizing: border-box;
}
label[for="nav-trigger"] .spinner {
  position: absolute;
  height: 3px;
  width: 100%;
  background-color: #fff;
}
label[for="nav-trigger"] .spinner.diagonal.part-1 {
  top: 6px;
}
label[for="nav-trigger"] .spinner.horizontal {
  top: 14px;
}
label[for="nav-trigger"] .spinner.diagonal.part-2 {
  top: 22px;
}
.nav-trigger + label,
#content {
  transition: all 0.3s;
}
.nav-trigger:checked + label {
  left: 216px;
}
.nav-trigger:checked + label > .horizontal {
  opacity: 0;
}
.nav-trigger:checked + label > .diagonal.part-1 {
  -webkit-transform: rotate(-135deg);
  transform: rotate(-135deg);
  margin-top: 10px;
}
.nav-trigger:checked + label > .diagonal.part-2 {
  -webkit-transform: rotate(135deg);
  transform: rotate(135deg);
  margin-top: -12px;
}
.nav-trigger:checked ~ #content {
  margin-left: 201px;
  box-shadow: 0 0 5px 5px rgba(20, 20, 30, 0.7);
}
#content {
  position: relative;
  z-index: 100;
  background-color: #14141e;
  overflow-x: hidden;
  overflow-y: auto;
  margin-left: 0;
  height: 100vh;
  width: auto;
  flex-direction: row;
  flex-flow: wrap;
  align-items: center;
  -webkit-scroll-snap-type: mandatory;
  -ms-scroll-snap-type: mandatory;
  scroll-snap-type: mandatory;
  -webkit-scroll-snap-points-y: repeat(100vh);
  -ms-scroll-snap-points-y: repeat(100vh);
  scroll-snap-points-y: repeat(100vh);
}
#content article {
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
}
#content article img {
  max-width: 100%;
  max-height: 100vh;
}
